social_posts.post_text:
🏁 @pdoolan and @jperks87 had a great qualifying run!  They are 9th in class off the line on Friday! 

@jordanpellegrino qualifies tomorrow between 1 and 3 PM PST! 

#genrightoffroad #mickeythompson #visionx #pscsteering #racelinewheels #kingofthehammers #koh #koh2023 #kohrookie23doolan

🏁I want to take a moment to share how proud I am of @pdoolan for driving us to 3rd place in the 4500 class at King of The Hammers! He drove a great race and kept my job easy! I also want to thank him for this opportunity.

🏁To be honest I told the crew that we were just going to drive our race and unless I ask, I didn't want to know where we were in the field.  Peter drove a smooth, quick pace that kept the car 100% the entire race!  When we crossed we had NO CLUE we were 3rd place!

I want to thank the @genrightoffroad crew for their help and support at KOH.  Without them it would not have been possible. 

A lot of people do not know that the same suspension geometry that we have on this race car is the same double triangulated rear 4 link kit and front 3 link kit that you can buy directly from GenRight Off Road in their legend suspension systems!

A shout out to @mickeythompsontires for making on heck of a tire.  We finished the race on the exact same tires we started on, they are still in great shape and we were not easy on them. 

@racelinewheels stayed strong the entire race as well! 

@psc_performance_steering steering stayed tight the entire race!

@visionxusa chase bar and front amber lights were super bright and kept us safe in the desert!

@warnindustries winch stayed reliable all race when we needed it!

@factor55 got us all set up with everything we needed for recovery!

@currieenterprises took everything we could throw at them! 

@torcousa fluids kept all of our temps down and engine running great all race! 

@ruggedradios got us dialed in before the race so we stayed connected the whole race without any issues!

@je_reel driveshafts Withstood the abuse.  With both of us used to wheeling on 40" tires instead of 37's, keeping the driveline alive with less ground clearance was crucial!

